import axios from "axios";

export const postRequest = async (url, header, data) => {
  let response = null;
  const request = {
    method: "post",
    header: header,
    url: url,
    data: data,
  };

  await axios(request)
    .then((res) => {
      console.log("from then");
      response = res.data;
    })
    .catch((errors) => {
      console.log(errors.msg);
      response = errors;
    });

  return response;
};
